VALUES ('3560070784691', 'Cordons Bleus de dinde aux 2 Fromages', 'Ingrédients (à la mise en oeuvre) : Viande de dinde 48%, farine de blé,fromag_e_ fondu 10%(_fromages_ 6,5% (dont 1,3% d\'_emmental_ et 1,2%  de _bleu_), eau, amidons modifiés, protéines de _lait_, _beurre_, sels de fonte : citrates de sodium, gélifiants : carraghénanes), eau, peau de volaille, gluten de _blé_, dextrose, sel, fibre de _blé_, glucose, aromes naturels, levure, épices (paprika et curcuma), protéines de pois, arômes de fumée, arôme (_lait_), antioxydant : érythorbate de sodium, conservateur : nitrite de sodium. Huiles de tournesol. Peut contenir éventuellement des traces d\'œuf. Ce produit est fabriqué à partir de viande de volaille origine UE Pourcentages exprimés sur le total de la recette avant friture.', 'https://static.openfoodfacts.org/images/products/356/007/078/4691/front_fr.22.400.jpg', '14', '3.6', '14', '1.5', '1.5', '14', '1.6', '0.62992125984252', '', '0');

