VALUES ('3560070808342', 'caldo pollo', 'Caldo de pollo deshidratado y aromatizado. Ingredientes del caldo deshidratado: Sal, grasa de palma 9,5%, maltodextrina, potenciadores del sabor (glutamato monosódico guanilato disódico, inosinato disódico), azúcar, almidón de maiz, jarabe de azúcar caramelizado, cebolla, extracto de levadura, grasa de pollo 0,5%, especias (cúrcuma, semillas de apio), acidulante: acido citrico, aroma, carne de pollo en polvo 0,1%, perejil. Puede contener trazas de gluten, leche, mostaza, soja y huevo. Comprando este producto, usted da soporte a los productores de grasa de palma sostenible RSPO y contribuye a una producción más responsable Para más información: www.rspo.info Utilización: Para obtener un buen caldo, disolver una pastilla en medio litro de agua hirviendo.', 'https://static.openfoodfacts.org/images/products/356/007/080/8342/front_es.6.400.jpg', '10', '6.8', '22', '8.8', '', '4.2', '58.7', '23.1102362204724', '', '0');

