VALUES ('3560070812172', 'Quiche Lorraine', 'Lait demi écrémé 21%, œufs de poules élevées en plein air 19%, farine de blé, crème fraîche 14%, beurre 6,4%, lardons fumés 6% (poitrine de porc 5%, sel, dextrose, arôme de fumée, arômes, acidifiant : acide citrique, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium), jambon fumé 6% (jambon de porc 5%, sel, sirop de glucose, dextrose, arômes naturels, arôme de fumée, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium), emmental râpé 6%, eau, amidons transformés de pomme de terre et de tapioca, sel, muscade, ferments lactiques.  Peut contenir des traces de : céleri, moutarde, soja. Cette quiche est composée de 73% de garniture et 27% de pâte. Origine :Cette quiche est fabriquée en Lorraine avec du lait, des œufs, de la farine de blé, de la crème, du beurre, de l\'emmental, de l\'eau et du sel d\'origine France. Les lardons et le jambon sont fabriqués avec de la viande de porc d\'origine France.', 'https://static.openfoodfacts.org/images/products/356/007/081/2172/front_fr.24.400.jpg', '16', '9.3', '17', '1.7', '0.8', '9.1', '0.78', '0.307086614173228', '', '1');

