VALUES ('3560070826018', 'Pavés de saumon rose du Pacifique', 'Composition / Samenstelling @ Pavés de saumon rose du Pacifique congelés. Saumon rose du Pacifique Ingrédients (Oncorhynchus gorbuscha pêché à la senne ou aux chaluts ou aux filets maillants et filets similaires ou aux filets tournants et filets soulevés en Océan Pacifique Nord-Ouest et Pacifique Nord-Est ). Qualité sans arête : Malgré toutes les précautions prises et nos contrôles très stricts, il peut qu\'exceptionnellement une arête subsiste dans nos produits. Nous vous prions de vérifier les bouchées destinées aux enfants en bas âge. @ Roze Pacific zalmmoten, diepvries. Ingrediënten: Roze Pacific zalm (Oncorhynchus gorbuscha gevangen met zegens of trawlnetten of kieuwnetten en soortgelijke netten of ringnetten en kruisnetten. in het noordwestelijke of noordoostelijke deel van de Stille Oceaan). Kwaliteit zonder graat: Ondanks alle voorzorgen en onze strenge controles, kan er uitzondertijk een graat voorkomen in onze producten. Wij vragen u om de stukken voor jonge kinderen altijd goed na te kijken.', 'https://static.openfoodfacts.org/images/products/356/007/082/6018/front_fr.8.400.jpg', '1.4', '0.3', '0.6', '0', '', '20', '0.45', '0.177165354330709', '', '1');

